import React from 'react'
import styled from 'styled-components'
import Navbar from '../components/Navbar';
import Announcement from '../components/Announcement';
import Newsletter from '../components/Newsletter';
import Footer from '../components/Footer';
import { Add, Remove } from '@material-ui/icons';
import { mobile } from '../responsive';


const Container=styled.div``;
const Wrapper=styled.div`
padding: 50px;
display: flex;
${mobile({padding: "10px",flexDirection:"column"})}
`;
const ImgContainer=styled.div`
flex:1;

`;

const Image=styled.img`
width: 100%;
height:90vh;
object-fit:cover;
`;

const InfoContainer=styled.div`
flex:1;
padding: 0px 50px;
`;

const Title=styled.h1`
font-weight:200;
`;

const Desc=styled.p`
margin: 20px 0px;
`;

const Price=styled.span`
font-weight:200;
font-size:40px;
`;

const FilterContainer=styled.div`
display : flex;
justify-content:space-between;
width:50%;
margin:30px 0px;
`;
const Filter=styled.div`
display : flex;
align-items:center;
`;
const FilterTitle=styled.span`
font-size: 20px;
font-weight:200;
`;
const FilterColor=styled.div`
width:20px;
height:20px;
border-radius: 50%;
background-color: ${props=>props.color};
margin:0px 5px;
cursor:pointer;
`;
const FilterSize=styled.select`
margin-left: 10px;
padding: 5px;
`;
const FilterSizeOption=styled.option``;

const AddContainer=styled.div`
display : flex;
align-items:center;
justify-content:space-between;
width:50%;
`;

const AmountContainer=styled.div`
display : flex;
align-items:center;
font-weight:700;
`;

const Amount=styled.span`
width:30px;
height:30px;
border-radius: 10px;
border: 1px solid teal;
display : flex;
align-items:center;
justify-content:center;
margin: 0px 5px;

`;

const Button=styled.button`
padding: 15px;
border: 2px solid teal;
backgrond-color: white;
cursor:pointer;
font-weight:500;

&:hover{
    background-color: #f8f4f4;
}
`;


const Product = () => {
  return (
    <Container>
        <Navbar/>
        <Announcement/>
        <Wrapper>
            <ImgContainer>
            <Image src="https://i.ibb.co/q0MxV7X/hoodie.jpg"/>
            </ImgContainer>
            <InfoContainer>
                <Title>Relaxed Fit Hoodie</Title>
                <Desc>Our hoodie combines fashion-forward design with ultimate comfort, making it a go-to piece for any season. Crafted with the highest quality materials, it offers a soft and plush feel that wraps you in warmth and relaxation.</Desc>
                <Price>â‚¹ 2500</Price>
                <FilterContainer>
                    <Filter>
                        <FilterTitle>Color</FilterTitle>
                        <FilterColor color="black"/>
                        <FilterColor color="blue"/>
                        <FilterColor color="beige"/>
                        <FilterColor color="grey"/>
                    </Filter>
                    <Filter>
                    <FilterTitle>Size</FilterTitle>
                       <FilterSize>
                        <FilterSizeOption>XS</FilterSizeOption>
                        <FilterSizeOption>S</FilterSizeOption>
                        <FilterSizeOption>M</FilterSizeOption>
                        <FilterSizeOption>L</FilterSizeOption>
                        <FilterSizeOption>XL</FilterSizeOption>
                       </FilterSize>
                    </Filter>
                </FilterContainer>
                <AddContainer>

                    <AmountContainer>
                        <Remove/>
                        <Amount>1</Amount>
                        <Add/>
                    </AmountContainer>
                    <Button>ADD TO CART</Button>
                </AddContainer>
            </InfoContainer>
        </Wrapper>
        <Newsletter/>
        <Footer/>
    </Container>
  )
}

export default Product
